import React from 'react';
// import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { Navigate } from 'react-router-dom'
import { GoogleLogin } from 'react-google-login';
import { isAuthenticated } from '../auth/AuthFunctions';

const googleClientId = '301139010020-rm1mnr8dlnd3656lt8j5f1gv6o001uv6.apps.googleusercontent.com'

class Login extends React.Component {

    constructor(props) {
        super(props);
        this.handleLogin = this.handleLogin.bind(this);
        this.handleLoginFailure = this.handleLoginFailure.bind(this);
    }

    async handleLoginOld(googleData) {

        // fetch user data for our backend 
        const resp = await fetch('/api/login/google', {
            method: 'POST',
            body: JSON.stringify({
                token: googleData.tokenId
            }),
            headers: {
                'Content-Type': 'application/json'
            }
        })
        //store the user in the client
        const data = await resp.json();
        if (data) {
            const token = data['access_token']
            localStorage.setItem('CruiserToken', token);
            this.setState({});
        }
    }

    async handleLogin(googleData) {
        // fetch user data for our backend 
        const resp = await fetch('/api/login', {
            method: 'POST',
            body: JSON.stringify({
                token: googleData.tokenId
            }),
            headers: {
                'Content-Type': 'application/json'
            }
        })
        //store the user in the client
        const data = await resp.json();
        if (data) {
            console.log(data);
            localStorage.setItem('CruiserToken', 'fakeToken');
            this.setState({});
        }
    }

    async handleLoginFailure(err) {
        console.log('Failed to login');
        console.log(err);
    }

    render() {

        const auth = isAuthenticated();

        if (auth) {
            return <Navigate to='/' />
        } else {
            return (
                <div>
                        <Container component="main" maxWidth="xs">
                            <CssBaseline />
                            <Box
                                sx={{
                                    marginTop: 8,
                                    display: 'flex',
                                    flexDirection: 'column',
                                    alignItems: 'center',
                                }}
                            >
                                <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
                                    <LockOutlinedIcon />
                                </Avatar>
                                <Typography component="h1" variant="h5">
                                    Sign in
                                </Typography>
                                <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
                                    <TextField
                                        margin="normal"
                                        required
                                        fullWidth
                                        id="email"
                                        label="Email Address"
                                        name="email"
                                        autoComplete="email"
                                        autoFocus
                                    />
                                    <TextField
                                        margin="normal"
                                        required
                                        fullWidth
                                        name="password"
                                        label="Password"
                                        type="password"
                                        id="password"
                                        autoComplete="current-password"
                                    />
                                    <FormControlLabel
                                        control={<Checkbox value="remember" color="primary" />}
                                        label="Remember me"
                                    />
                                    <Button
                                        type="submit"
                                        fullWidth
                                        variant="contained"
                                        sx={{ mt: 3, mb: 2 }}
                                    >
                                        Sign In
                                    </Button>
                                    <Grid container>
                                        <Grid item xs>
                                            <Link href="#" variant="body2">
                                                Forgot password?
                                            </Link>
                                        </Grid>
                                        <Grid item>
                                            <Link href="#" variant="body2">
                                                {"Don't have an account? Sign Up"}
                                            </Link>
                                        </Grid>
                                    </Grid>
                                </Box>
                            </Box>
                            <Copyright sx={{ mt: 8, mb: 4 }} />
                        </Container>
                    <div>
                        <GoogleLogin
                            clientId={googleClientId}
                            buttonText='Sign In with Google'
                            onSuccess={this.handleLogin}
                            onFailure={this.handleLoginFailure}
                            cookiePolicy={'single_host_origin'}
                        />
                    </div>
                </div>
            )
        }
    }
}

export default Login;
